import React from 'react';
import { SafeAreaView, View, FlatList, StyleSheet, Text, StatusBar } from 'react-native';
import axios from 'axios';

export default class List extends React.Component {
    state = {
        recette: []
      }

      componentDidMount() {
        axios.get(`https://api.spoonacular.com/recipes/complexSearch?apiKey=bbf788cda4f34fcc8b58403847622e97&number=100`)
          .then(res => {
            const recette = res.data.results;
            console.log(res.data),
            this.setState({ recette });
          })
      }

      render() {
          const recipe = this.state.recette
        return (
          <ul>
            { recipe.map(item => 
                <li>
                    <img src={item.image}></img>
                    <p>{item.title}</p>
                </li>)
            }

          </ul>
        )
      }
}
